style.css:
::-webkit-scrollbar {
  width: 11px;
  height: 11px;
}
::-webkit-scrollbar-button {
  width: 0px;
  height: 0px;
}
::-webkit-scrollbar-thumb {
  background: #aa89cc;
  border: 2px solid #8a6fa6;
  border-radius: 50px;
}
::-webkit-scrollbar-thumb:hover {
  background: #ceb5e8;
  border: 3px solid #8a6fa6
}
::-webkit-scrollbar-thumb:active {
  background: #ffffff;
}
::-webkit-scrollbar-track {
  background: #ceb5e8;
  border: 0px none #ffffff;
  border-radius: 53px;
}
::-webkit-scrollbar-track:hover {
  background: #b69dd1;
}
::-webkit-scrollbar-track:active {
  background: #ceb5e8;
}
::-webkit-scrollbar-corner {
  background: transparent;
}
